import React from "react";
import SearchBar from "./SearchBar";
import _ from "lodash";

class App extends React.Component {
  constructor() {
    super();

    this.state = {
      stocks: [],
      term: null,
      value: "",
    };
  }

  onTermSubmit = (data) => {
    // const stocks = data["Time Series (Daily)"].map((time) => console.log(time));
    console.log(data);

    var tempDataStore = [];
    var tSeries = data["Time Series (Daily)"];
    for (var tempData in tSeries) {
      // Here You get your Date
      console.log("Your Date - " + tempData);
      console.log(tSeries[tempData]);
      console.log(tSeries[tempData]["1. open"]);
      console.log(tSeries[tempData]["2. high"]);
      tempDataStore.push({
        Date: tempData,
        open: tSeries[tempData]["1. open"],
      });
    }

    console.log(tempDataStore);

    // .catch(error => console.log(error))
  };

  render() {
    return (
      <div className=" ui container">
        <SearchBar onTermSubmit={this.onTermSubmit} />
      </div>
    );
  }
}

export default App;
